import React from 'react'
import Navbar from './Navbar'

const Home = () => {
  const { useEffect, useState } = React;

const images = [
  { img: 'data:image/jpeg;base64,' },
  { img: 'data:image/jpeg;base64,' },
  { img: 'data:image/jpeg;base64,' }
];


  const [currentSlide, setCurrentSlide] = useState(0);

  useEffect(() => {
    const interval2 = setInterval(() => {
      setCurrentSlide((prevSlide) =>
        prevSlide === images.length - 1 ? 0 : prevSlide + 1,
      );
    }, 3000);

    return () => {
      clearInterval(interval2);
    };
  }, []);

  return (
    <div className="grid grid-cols-1 grid-rows-2 lg:grid-rows-1 lg:grid-cols-2 w-full">

      <div className="images lg:order-1" data-aos="fade-up">
        <div className="flex justify-center flex-grow-0">
          {images.map((image, index) => (
            <div
              key={image.id}
              className={`my-14 center-0  h-full transition-opacity duration-1000 ${
                index === currentSlide ? 'opacity-100' : 'opacity-0'
              } ${index >= 0 ? 'absolute' : ''}`}
            >
              <img src={image.img} className="rounded-md lg:w-full flex mx-auto" alt="nothing" />
            </div>
          ))}
        </div>
      </div>

    <div>


</div>

    </div>
  )
}

export default Home